// BottomNavigation.jsx
import React from 'react';

const BottomNavigation = () => {
  return (
    <nav className="bottom-nav">
      <ul>
        <li><button className="nav-button">Streaming</button></li>
        <li><button className="nav-button">Genre</button></li>
        <li><button className="nav-button">Batch</button></li>
      </ul>
    </nav>
  );
};

export default BottomNavigation;
